import './App.css';
import Grid from "./Components/Grid";
import React, { createContext, useState } from 'react';

export const AppContext = createContext(null);

function App() {

  const [bin, setBin] = useState("0");

  return (
    <AppContext.provider value={{bin, setBin}}>
    <div className='App'>
      <Grid/>
    </div>
    </AppContext.provider>
  );
}

export default App;
